	public Connection createConnection(String dbSchemaName) {

		String dbNpActor = getPropertyOf("dbUrl") + dbSchemaName;
		String jdbcDriver = getPropertyOf("jdbcDriver");
		try {
			Class.forName(jdbcDriver);
			conn = DriverManager.getConnection(dbNpActor, getPropertyOf("dbUserName"), getPropertyOf("dbPassword"));
			stmt = conn.createStatement();
		} catch (ClassNotFoundException e) {
			e.printStackTrace();
		} catch (SQLException e) {
			e.printStackTrace();
		}
		return conn;

	}

